    def calculate_bollinger(self):

        n_std = 2
        n_window = 20

        df_bollinger = pd.DataFrame()
        df_bollinger['label'] = self.data_frame['label']
        df_bollinger['close'] = self.data_frame['close']
        df_bollinger['typical'] = (self.data_frame['high'] + self.data_frame['low'] + self.data_frame['close'])/3
        df_bollinger['moving average'] = df_bollinger['typical'].rolling(window=n_window).mean()
        df_bollinger['standard deviation'] = df_bollinger['typical'].rolling(window=n_window).std()

        df_bollinger['upper'] = df_bollinger['moving average'] + (df_bollinger['standard deviation'] * n_std)
        df_bollinger['lower'] = df_bollinger['moving average'] - (df_bollinger['standard deviation'] * n_std)

        return df_bollinger
